import React from 'react';
import { AppBar, CssBaseline, Toolbar, Typography , Box , IconButton ,Button , Container } from '@mui/material'
import { PhotoCamera ,  } from '@mui/icons-material';
import { styled } from '@mui/material/styles';
import Paper from '@mui/material/Paper';

const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }));

const App = () => {

    return (
            <>

            <CssBaseline/>

                {/* Navigation Bar  */}

            <Box sx={{ flexGrow: 1 }}>
                <AppBar position="static">
                    <Toolbar>
                    <IconButton
                        size="large"
                        edge="start"
                        color="inherit"
                        aria-label="menu"
                        sx={{ mr: 2 }}
                    >
                        <PhotoCamera />
                    </IconButton>
                    <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                        News
                    </Typography>
                    <Button color="inherit">Login</Button>
                    </Toolbar>
                </AppBar>

                <main>
                    <Container fixed maxWidth = "md">
                        <Box sx={{ bgcolor: '#cfe8fc', height: '30vh' }} >

                            <Typography varient = "h2" fontSize={ 50 } align = "center" paddingTop={5} fontWeight='bold'>
                            Aim High With Brilliant Writing
                            </Typography>

                            <Button variant="contained"  color="success" align = "center"  > Upgrade to Grammarly Premium </Button>

                        </Box>
                       
                    </Container>

                </main>


            </Box>

            {/* Section - 1 Below Header part  */}
           
            </>

        );
}

export default App;
